import React from 'react';
import styled from 'styled-components';

const ActivitiesStyle =styled.div`
    padding: 20px 32px;
    width:100px;
    height:100px;
    
    
    position:flex;
    background: white;
    border-radius:16px;
    
`;

const imgStyle =styled.div`
    width:fill;
    height:50px;
`;

const Activities =({imgsrc,description})=>{
    return(
      <div>
          <img src={imgsrc} />
          <p>{description}</p>
      </div>
    );
};
export default Activities;
